import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class Course {
  constructor(college, dept, number, section, prof) {
    this.college = college;
    this.dept = dept;
    this.number = number;
    this.section = section;
    this.prof = prof;
    this.key = `${this.college} ${this.dept} ${this.number} ${this.section} ${this.prof}`;
  }
}

class App extends Component {
  render() {
    let courses = [
      new Course('CAS', 'CS', '112', 'B1', 'Sullivan'),
      new Course('CAS', 'CS', '332', 'A1', 'Bun'),
      new Course('CAS', 'CS', '350', 'A1', 'Sarkar'),
    ];
    return (
        <ol>
          {
            courses.map(course => <li key={course.key}>{course.college} {course.dept} {course.number} {course.section} {course.prof}</li>)
          }
        </ol>
    );
  }
}

export default App;
